Performer 400 EGR (2V or 4V carburetor)Ford 351-M400 V8 PERFORMER 400 EGR (idle-5500 rpm) Designed for 351-M400 Fords in one of the three following configurations: 1) OEM 2V carb and EGR system with supplied 2V EGR spacer; 2) 4V EGR system with either an Edelbrock 8053 4V EGR spacer, or an Edelbrock 8017 and Ford E4ZZ9A-589E 4V EGR spacer; 3) For off-highway use, non-EGR 4V system with an Edelbrock 8714 adapter. Performer 400 EGR manifold 3771 is a stock replacementstreet legal part for 351-M400 2V V8s; 1974-80.
Carburetor Recommendations: OEM 2-bbl. Off-highway, non-EGR 4V: Edelbrock Thunder Series AVS or Performer Series carb, 600-650 cfm, for auto. trans. use our 1483 amp; 1493 or 1844 amp; 1847
Installation Notes: For non-EGR, off-road applications, use 8714 4V spacer. Intake gasket: Fel-Pro MS96020. Replacement EGR plate gaskets: 3896 amp; 3897. Manifold ht: A-3.60", B-4.75" (without EGR plates installed) see AB Measurements. Port exit dimensions: 1.16" x 1.66".nbsp;

