Carburetor Recommendations: OEM 2-bbl. Off-highway, non-EGR 4V: Edelbrock Thunder Series AVS or Performer Series carb, 600-650 cfm, for auto. trans. use our 1483 amp; 1493 or 1844 amp; 1847
Installation Notes: For non-EGR, off-road applications, use 8714 4V spacer. Intake gasket: Fel-Pro MS96020. Replacement EGR plate gaskets: 3896 amp; 3897. Manifold ht: A-3.60", B-4.75" (without EGR plates installed) see AB Measurements. Port exit dimensions: 1.16" x 1.66".nbsp;

