Performer 383 (EGRnon-EGR)Chrysler 361-400 V8 PERFORMER 383 (idle-5500 rpm) Designed for street 361-383-400 c.i.d. Chrysler V8s that measure 7.75" across block. For EGR, 2186 is stock replacementstreet legal part for 400 V8s with OEM 4-bbl. carb.; 1972-78. For non-EGR, 2186 is stock replacementstreet legal part for 361-383-400 V8s with OEM 4-bbl. carb.; 1966-72 (1973 non-CA); except stock equipped EGR. May be used with OEM or aftermarket carbs.
Carburetor Recommendations: OEM 4-bbl. Edelbrock Thunder Series AVS or Performer Series carb, 600-800 cfm, use our 1481 or 1843 ThrottleTransmission Lever Kit.
Installation Notes: Recommended intake gasket: 7225. Manifold height: A-3.65", B-4.35", measured to engine block, see AB Measurements. Port exit dimensions: 1.14" x 2.12".nbsp;

